import React, { Component } from 'react';
import './Session.css'
import { GoogleLogin } from 'react-google-login'
import axios from 'axios';
import { useState } from 'react'


function Session() {

  const responseGoogle = response => {
    console.log(response)
    const { code } = response
    axios.post('/api/create-tokens', { code })
      .then(response => {
        console.log(response.data)
      })
      .catch(error => console.log(error.message))
  }

  const handleSubmit = (e) => {
    e.preventDefault()
  }


  const responseError = error => {
    console.log(error)
  }

  const [summary, setSummary] = useState('')
  const [description, setDescription] = useState('')
  const [location, setLocation] = useState('')
  const [startDateTime, setStartDateTime] = useState('')
  const [endDate, setDateTime] = useState('')

  return (
      <div>
        <div className="App">
          <h1>Add Sessions and Events</h1>
          </div>
            <div>
              <GoogleLogin 
                  clientId="708105023641-t350k3usoo751tfnilu9hrdokjmmli8v.apps.googleusercontent.com"
                  buttonText="Add sessions and events"
                  onSuccess={responseGoogle}
                  onFailure={responseError}
                  cookiePolicy={'single_host_origin'}

                  responseType="code"
                  accessType="offline"
                  scope="openid email profile https://www.googleapis.com/auth/calendar"
                  />
      </div>
      <div>
        <form onSubmit={handleSubmit}>
          <label htmlFor='summary'>summary</label>
          <br />
          <input type='text' id='summary' value={summary} onChange={e => setSummary(e.target.value) } />
        <br />

        <label htmlFor='description'>Description</label>
          <br />
          <textarea id='description' value={description} onChange={e => setDescription (e.target.value)} />
        <br />

        <label htmlFor='location'>location</label>
          <br />
          <input type='text' id='summary' value={summary} onChange={e => setSummary} />
        <br />

        <label htmlFor='summary'>summary</label>
          <br />
          <input type='text' id='summary' value={summary} onChange={e => setSummary} />
        <br />
        </form>
      </div>
  </div>
  )
}

export default Session
